        "value": "async ({ deep, require, data: { newLink: pay, triggeredByLinkId } }) => {\n\n    // requires\n    const _ = require('lodash');\n    const crypto = require('crypto');\n    const axios = require('axios');\n\n    const dc = '@deep-foundation/core';\n    const dp = '@deep-foundation/payments';\n    const dpt = '@deep-foundation/payments-tinkoff-c2b';\n\n    const _Object = await deep.id(dp, 'Object');\n    const Sum = await deep.id(dp, 'Sum');\n    const Payed = await deep.id(dp, 'Payed');\n    const PayUrl = await deep.id(dp, 'PayUrl');\n    const ReturnUrl = await deep.id(dp, 'ReturnUrl');\n    const _Error = await deep.id(dp, 'Error');\n\n    const Payment = await deep.id(dpt, 'Payment');\n    const TerminalKey = await deep.id(dpt, 'TerminalKey');\n    const TerminalPassword = await deep.id(dpt, 'TerminalPassword');\n    const CallbackUrl = await deep.id(dpt, 'CallbackUrl');\n    const Email = await deep.id(dpt, 'Email');\n    const Phone = await deep.id(dpt, 'Phone');\n    const Name = await deep.id(dpt, 'Name');\n\n    const API = `https://securepay.tinkoff.ru/v2`;\n\n    // load\n    const { data: _payment } = await deep.select({\n        _or: [\n            { id: pay.from_id },\n            { type_id: { _in: [Email, Phone, Name, Payed, _Error, Sum, _Object, ReturnUrl] }, from_id: pay.from_id },\n        ],\n        ...deep._queryTypesNamesSymbols(),\n    }, { apply: `payment-${pay.from_id}` });\n\n    const { data: _business } = await deep.select({\n        type_id: { _in: [TerminalKey, TerminalPassword, CallbackUrl] },\n        out: { id: pay.to_id },\n        ...deep._queryTypesNamesSymbols(),\n    }, { apply: `business-${pay.to_id}` });\n\n    // get\n    const payment = deep.get(pay.from_id);\n    const [email] = deep.ml.select({ type_id: Email, from_id: payment.id });\n    const [phone] = deep.ml.select({ type_id: Phone, from_id: payment.id });\n    const [name] = deep.ml.select({ type_id: Name, from_id: payment.id });\n    const [sum] = deep.ml.select({ type_id: Sum, from_id: payment.id });\n    const [object] = deep.ml.select({ type_id: _Object, from_id: payment.id });\n    const [returnUrl] = deep.ml.select({ type_id: ReturnUrl, from_id: payment.id });\n    const [payed] = deep.ml.select({ type_id: Payed, from_id: payment.id });\n    const [error] = deep.ml.select({ type_id: _Error, from_id: payment.id });\n\n    const [callbackUrl] = deep.ml.select({\n      type_id: CallbackUrl,\n      in: { type_id: Contain, from_id: payment.to_id },\n    });\n    const [terminalKey] = deep.ml.select({\n      type_id: TerminalKey,\n      in: { type_id: Contain, from_id: payment.to_id },\n    });\n    const [terminalPassword] = deep.ml.select({\n      type_id: TerminalKey,\n      in: { type_id: TerminalPassword, from_id: payment.to_id }\n    });\n\n    // validate\n    let errors: any = [];\n    if (!email?.value?.value) errors.push('!email');\n    if (!phone?.value?.value) errors.push('!phone');\n    if (!name?.value?.value) errors.push('!name');\n    if (!sum?.value?.value) errors.push('!sum');\n    if (!object) errors.push('!object');\n    if (!!returnUrl && !returnUrl?.value?.value) errors.push('!url');\n\n    if (!!payed) errors.push('!!payed');\n    if (!!error) errors.push('!!error');\n\n    if (!terminalKey?.value?.value) errors.push('!terminalKey');\n    if (!terminalPassword?.value?.value) errors.push('!terminalPassword');\n    if (!callbackUrl?.value?.value) errors.push('!callbackUrl');\n    if (errors.length) throw new Error(errors.join(' '));\n\n    // request\n    const options = {\n        TerminalKey: terminalKey?.value?.value,\n        OrderId: `${Date.now()}${pay.from_id}`,\n        CustomerKey: pay.from_id,\n        NotificationURL: callbackUrl?.value?.value,\n        SuccessURL: returnUrl?.value?.value,\n        PayType: 'T',\n        Amount: sum?.value?.value,\n        Language: 'ru',\n        Recurrent: 'Y',\n        DATA: {\n            email: email?.value?.value,\n            phone: phone?.value?.value,\n            name: name?.value?.value,\n        },\n    };\n\n    let result;\n    try {\n        const { Receipt, DATA, Shops, ...optionsToCrypto } = options as any;\n        const dataWithPassword = { Password: terminalPassword?.value?.value, ...optionsToCrypto };\n        const dataString = Object.keys(dataWithPassword)\n            .sort((a, b) => a.localeCompare(b))\n            .map((key) => dataWithPassword[key])\n            .reduce((acc, item) => `${acc}${item}`, '');\n        const hash = crypto.createHash('sha256').update(dataString).digest('hex');\n\n        const response = await axios({\n            method: 'post',\n            url: `${API}/Init`,\n            headers: { 'Content-Type': 'application/json' },\n            data: { ...options, Token: hash },\n        });\n\n        const error = response.data.Details;\n\n        result = { error, request: options, response: response.data };\n    } catch (error) {\n        result = { error, request: options, response: null };\n    }\n    if (result.error) throw new Error(result.error);\n\n    // create payurl for user\n    await deep.insert({\n        type_id: PayUrl,\n        from_id: pay.from_id,\n        to_id: pay.from_id,\n        string: result.response.PaymentURL,\n        containerId: pay.from_id,\n        name: 'url',\n    });\n\n    // save bankPaymentId for restore in onPay\n    await deep.value(pay.from_id, parseInt(result.response.PaymentId));\n};\n",
