        "value": "async (req, res, next, { deep, require, gql }) => {\n  res.send('ok');\n\n  const allowedStatuses = [\"AUTHORIZED\", \"CONFIRMED\"];\n  if (!allowedStatuses.includes(req.body.Status)) {\n    return next();\n  }\n\n  // requires\n  const _ = require('lodash');\n  const crypto = require('crypto');\n  const axios = require('axios');\n\n  const dc = '@deep-foundation/core';\n  const dp = '@deep-foundation/payments';\n  const dpt = '@deep-foundation/payments-tinkoff-c2b';\n\n  const _Object = await deep.id(dp, '_Object');\n  const Pay = await deep.id(dp, 'Pay');\n  const Sum = await deep.id(dp, 'Sum');\n  const Payed = await deep.id(dp, 'Payed');\n  const PayUrl = await deep.id(dp, 'PayUrl');\n  const ReturnUrl = await deep.id(dp, 'ReturnUrl');\n  const _Error = await deep.id(dp, 'Error');\n\n  const Payment = await deep.id(dpt, 'Payment');\n  const TerminalKey = await deep.id(dpt, 'TerminalKey');\n  const TerminalPassword = await deep.id(dpt, 'TerminalPassword');\n  const TerminalUrl = await deep.id(dpt, 'TerminalUrl');\n  const Email = await deep.id(dpt, 'Email');\n  const Phone = await deep.id(dpt, 'Phone');\n  const Name = await deep.id(dpt, 'Name');\n  const Business = await deep.id(dpt, 'Business');\n  const Client = await deep.id(dpt, 'Client');\n\n  const API = `https://securepay.tinkoff.ru/v2`;\n\n  const bankPaymentId = parseInt(req.body.PaymentId);\n\n  const { data: [payment] } = await deep.select({\n    type_id: Payment,\n    object: { value: { _contains: { bankPaymentId } } },\n    ...deep._queryTypesNamesSymbols(),\n  }, { apply: `bankPaymentId-${bankPaymentId}` });\n\n  const userId = payment.from_id;\n  const businessId = payment.to_id;\n\n  await deep.select({\n    from_id: payment.id,\n    return: {\n      ...deep._queryTypesNamesSymbols().return,\n      _to: { relation: 'to', ...deep._queryTypesNamesSymbols() },\n    },\n  }, { apply: `payment-${payment.id}` });\n\n  const { data: _business } = await deep.select({\n      type_id: { _in: [TerminalKey, TerminalPassword, TerminalUrl] },\n      out: { id: businessId },\n      ...deep._queryTypesNamesSymbols(),\n  }, { apply: `business-${businessId}` });\n\n  // get\n  const [pay] = deep.ml.select({ type_id: Pay, from_id: payment.id });\n  const [payed] = deep.ml.select({ type_id: Payed, from_id: payment.id });\n  const [error] = deep.ml.select({ type_id: _Error, from_id: payment.id });\n\n  const [terminalKey] = deep.ml.select({\n    type_id: TerminalKey,\n    in: { type_id: Contain, from_id: payment.to_id },\n  });\n  const [terminalPassword] = deep.ml.select({\n    type_id: TerminalKey,\n    in: { type_id: TerminalPassword, from_id: payment.to_id }\n  });\n\n  // validate\n  let errors: any = [];\n  if (!!payed) errors.push('!!payed');\n  if (!!error) errors.push('!!error');\n\n  if (!terminalKey?.value?.value) errors.push('!terminalKey');\n  if (!terminalPassword?.value?.value) errors.push('!terminalPassword');\n  if (errors.length) throw new Error(errors.join(' '));\n\n  // analize\n  if (req.body.Status === 'AUTHORIZED') {\n    await handleAuthorizedStatus();\n  } else if (req.body.Status === 'CONFIRMED') {\n    await handleConfirmedStatus();\n  }\n\n  async function handleAuthorizedStatus(){\n    const confirmOptions = {\n      TerminalKey: terminalKey?.value?.value,\n      Amount: req.body.Amount,\n      PaymentId: req.body.PaymentId,\n    };\n\n    const confirmResult = await confirm({\n      options: confirmOptions,\n    });\n\n    if (confirmResult.error) throw new Error(confirmResult.error);\n\n    return confirmResult;\n  };\n\n  async function confirm({ options }) {\n    try {\n      const response = await axios({\n        method: 'post',\n        url: `${API}/Confirm`,\n        data: { \n          ...options,\n          Token: await generateToken({\n            options: options,\n          }),\n        },\n      });\n\n      const error = response.data.Details;\n\n      return {\n        error,\n        request: options,\n        response: response.data,\n      };\n    } catch (error) {\n      return {\n        error,\n        request: options,\n        response: null,\n      };\n    }\n  };\n\n  async function generateToken({ options }) {\n    const { Receipt, DATA, Shops, ...restData } = options;\n    const dataWithPassword = {\n      Password: terminalPassword?.value?.value,\n      ...restData,\n    };\n\n    const dataString = Object.keys(dataWithPassword)\n      .sort((a, b) => a.localeCompare(b))\n      .map((key) => dataWithPassword[key])\n      .reduce((acc, item) => `${acc}${item}`, '');\n\n    return crypto.createHash('sha256').update(dataString).digest('hex');\n  };\n\n  async function handleConfirmedStatus() {\n    await deep.insert({\n      tpe_id: Payed,\n      from_id: businessId,\n      to_id: pay.id,\n    });\n\n    const { data: [client] } = await deep.select({\n      type_id: Client,\n      number: +req.body.CardId,\n    });\n    let clientId = client.id;\n    if (!client) {\n      const { data: [client] } = await deep.insert({\n        type_id: Client,\n        containerId: userId,\n        name: req.body.Pan,\n        number: +req.body.CardId,\n      });\n      clientId = client.id;\n    }\n  };\n};\n",
