        "id": 2092,
        "value": "async ({ deep, data, require, Go }) => {\n  const React = require('react');\n  \n  const dc = '@deep-foundation/core';\n  const dpl = '@deep-foundation/perception-links';\n  const db = '@deep-foundation/bots';\n  const c = require('@chakra-ui/react');\n\n  const Contain = deep.idLocal(dc, 'Contain');\n  const Bots = await deep.id(db, 'Bots');\n  const Bot = await deep.id(db, 'Bot');\n  const Compatable = deep.idLocal(dpl, 'Compatable');\n  const Tree = deep.idLocal(dpl, 'Tree');\n  const TreeLink = deep.idLocal(dpl, 'TreeLink');\n  const TreeList = deep.idLocal(dpl, 'TreeList');\n  const TreeLinkButton = deep.idLocal(dpl, 'TreeLinkButton');\n  const Stack = deep.idLocal(dpl, 'Stack');\n  const After = await deep.id(dpl, 'After');\n\n  const Item = ({ link, isActive }) => {\n    const go = Go.useGo();\n    return (link?.id === After ? (\n      <go.Button w='100%' isActive={isActive}>+</go.Button>\n    ) : (<go.Handler\n      handlerId={TreeLinkButton} linkId={link.id} isActive={isActive}\n    />))\n  };\n\n  return ({\n    go,\n    goHandler,\n\n    handlerId,\n    Component,\n\n    linkId,\n    link,\n\n    children,\n\n    isActive,\n\n    ...props\n  }, ref) => {\n    const disclosure = c.useDisclosure();\n    const { data: bots } = deep.useSubscription({\n      type: {\n        type_id: Bot,\n      },\n      return: { contains: { relation: 'in', type_id: Contain } },\n    });\n    const { data: possible } = deep.useSubscription({\n      type_id: Bot,\n      return: { contains: { relation: 'in', type_id: Contain } },\n    });\n    const links = [...bots, { id: After }];\n    \n    const openLink = async (id) => {\n      !!id && go.parent(Tree).do('open', { handlerId: TreeLink, id: id, prevId: linkId })\n      await go.parent(Tree).await(id);\n      go.parent(Tree).focus(id);\n    };\n\n    return <go.On\n      do={{\n        exec: (g,v,o) => {\n          if (!o.id) return;\n          if (o.id === After) go.do(o.id);\n          else openLink(o.id);\n        },\n        [After]: (g,v,o) => {\n          disclosure.onOpen();\n        },\n      }}\n    >\n      <c.Flex direction='column'>\n        {<go.Provider linkId={Stack}>\n          <go.Component\n            path={[dpl, 'Stack']} links={links} direction='vertical' flex='1' Item={Item}\n          />\n        </go.Provider>}\n        {disclosure.isOpen && <go.Component path={[dpl, 'Finder']}\n          disclosure={disclosure} initialId={Bots} initialHandlerId={TreeList}\n          onSubmit={async (id) => {\n            disclosure.onClose();\n            const { data: [bot] } = await deep.insert({\n              type_id: id,\n              containerId: deep.linkId,\n            });\n            openLink(bot.id);\n          }}\n          startProps={{ initialResults: possible }}\n        />}\n      </c.Flex>\n    </go.On>;\n  };\n}",
