        "id": 2695,
        "value": "\nasync (req, res, next, { deep, require, gql }) => {\n    res.header('Access-Control-Allow-Origin', '*');\n    res.header('Access-Control-Allow-Headers', 'Origin, X-Requested-With, Content-Type, Accept, Authorization');\n    res.header('Access-Control-Allow-Methods', 'GET, POST, PUT, PATCH, DELETE, OPTIONS');\n\n    const { token } = req.query;\n    const currentLinkId = req.body.linkId;\n\n    let passwordUser = '';\n    let loginUser = '';\n    let globalUserId = null;\n    //     \n    const tokenLink = await deep.select({\n      type_id: await deep.id('@timax/passport-verification', 'TokenVerification'),\n      string: { value: token }\n    });\n    if (tokenLink.data.length > 0){\n        //     ,    \n        const usernameLink = await deep.select({\n          type_id: await deep.id('@timax/passport-verification', 'UsernameDataTemporary'),\n          to_id: tokenLink.data[0].id \n        });\n\n        const passwordLink = await deep.select({\n          type_id: await deep.id('@timax/passport-verification', 'PasswordDataTemporary'),\n          to_id: tokenLink.data[0].id \n        });\n\n            loginUser = usernameLink.data[0].value.value;\n            passwordUser = passwordLink.data[0].value.value;\n        //    \"User\"\n        const { data: [{ id: usernameId }] } = await deep.insert({\n            type_id: await deep.id('@timax/passport-authorization', 'Username'),\n            string: { data: { value: loginUser } },\n            });\n            // create new user\n        const { data: [{ id: userId }] } = await deep.insert({\n            type_id: await deep.id('@deep-foundation/core', 'User'),\n            out: { \n                data: [\n                {\n                    type_id: await deep.id('@deep-foundation/core', 'Join'),\n                    to_id: await deep.id('deep', 'users')\n                },\n                ] \n            }\n            });\n\n        const t = await deep.insert({\n            type_id: await deep.id('@l4legenda/auth-core', 'ActionSelectUser'),\n            from_id: userId,\n            to_id: userId,\n        })\n\n        console.log(t);\n\n        // and create new password\n        const { data: [{ id: passwordId }] } = await deep.insert({\n            type_id: await deep.id('@timax/passport-authorization', 'Password'),\n            string: { data: { value: passwordUser } },\n            from_id: usernameId,\n            to_id: userId,\n        });\n        //    \n        // globalUserId = userId;\n        // console.log(globalUserId);\n        // await deep.login({\n        //     linkId: 373,\n        //     });\n        console.log(globalUserId);    \n        const hasAllowLogin = await deep.can(\n            currentLinkId,\n            globalUserId,\n            await deep.id('@deep-foundation/core', 'AllowLogin')\n        )\n        if(!hasAllowLogin) {\n            const r = await deep.insert({\n            type_id: await deep.id('@l4legenda/auth-core', 'ActionLoginUser'),\n            from_id: currentLinkId,\n            to_id: globalUserId,\n            })\n            console.log(r);\n        }\n    \n\n        res.send('Your email has been successfully verified and user account created!');\n    } else {\n    res.status(404).send('Verification token not found or already used.');\n        }\n    }",
