        "value": "({ deep, data, require, go }) => {\n    const React = require('react');\n    const c = require('@chakra-ui/react');\n    const dpl = '@deep-foundation/perception-links';\n    const dc = '@deep-foundation/core';\n    return ({ go, linkId, containerId, disclosure: _disclosure, isActive, }, ref) => {\n        if (!linkId)\n            throw new Error('!linkId');\n        const __disclosure = c.useDisclosure();\n        const disclosure = _disclosure || __disclosure;\n        return React.createElement(go.On, { do: {\n                'exec': () => disclosure.onOpen(),\n            } },\n            React.createElement(c.Button, { ref: ref, variant: isActive ? 'active' : undefined, justifyContent: 'center', position: 'relative', onClick: () => go.do('exec') },\n                React.createElement(c.Box, { position: 'absolute', right: 1, top: 1 }, true ? '' : ''),\n                React.createElement(c.Text, { pr: 1 }, \"x\"),\n                \" delete\"),\n            React.createElement(go.Component, { path: [dpl, 'LinkDeleteModal'], disclosure: disclosure, linkId: linkId, containerId: containerId }));\n    };\n};\n//# sourceMappingURL=data:application/json;base64,",
