        "id": 2212,
        "value": "async ({ deep, require, Go }) => {\n    const React = require('react');\n    const c = require('@chakra-ui/react');\n    const { useState, useEffect, useCallback, useRef } = React;\n    const { withTheme } = require('@rjsf/core');\n    const { Theme: ChakraUITheme } = require('@rjsf/chakra-ui');\n    const { default: validator } = require('@rjsf/validator-ajv8');\n    const { Button, ButtonGroup } = require('@chakra-ui/react');\n    const Form = withTheme(ChakraUITheme);\n\n    const dc = '@deep-foundation/core';\n    const dj = '@deep-foundation/jsonschema';\n    const djf = '@deep-foundation/jsonschema-form';\n\n    const Contain = await deep.id(dc, 'Contain');\n    const Possible = await deep.id(dj, 'Possible');\n    const Property = await deep.id(dj, 'Property');\n    const Required = await deep.id(dj, 'Required');\n    const UIProperty = await deep.id(djf, 'UIProperty');\n\n    return ({\n      go,\n      goHandler,\n  \n      handlerId,\n      Component,\n  \n      linkId,\n      link,\n  \n      children,\n  \n      isActive,\n\n      buttonProps = {},\n  \n      ...props\n    }) => {\n      const typeId = link.type_id;\n      // const schemaId = link.type_id;\n      // const { data: ids } = deep.useDeepSubscription({\n      //   down: {\n      //     tree_id: { _eq: deep.idLocal('@deep-foundation/core', 'containTree') },\n      //     _or: [{\n      //       link_id: { _id: ['@deep-foundation/jsonschema', 'Property'] },\n      //     }, {\n      //       link_id: { _id: ['@deep-foundation/jsonschema', 'Required'] },\n      //     }, {\n      //       link_id: { _id: ['@deep-foundation/jsonschema-form', 'UIProperty'] },\n      //     }]\n      //   }\n      // });\n      // const formDown = deep.useDeepSubscription({\n      //   up: {\n      //     tree_id: deep.idLocal('@deep-foundation/core', 'containTree'),\n      //     parent_id: schemaId,\n      //   },\n      // });\n      // const { data } = deep.useDeepSubscription({\n      //   up: {\n      //     tree_id: deep.idLocal('@deep-foundation/core', 'containTree'),\n      //     parent_id: link.id,\n      //   },\n      //   type_id: { _neq: deep.idLocal('@deep-foundation/core', 'Contain') },\n      // });\n      // const schemaLink = deep.minilinks?.byId?.[schemaId];\n      // const propertyLinks: any = {};\n      // const properties: any = {};\n      // const uipropertyLinks: any = {};\n      // const uiproperties: any = {};\n      // const formData: any = {};\n      // const formDataLinks: any = {};\n      // const schema = {\n      //   type: 'object',\n      //   properties,\n      //   required: [],\n      // };\n      // if (ids.length) {\n      //   schemaLink?.outByType[deep.idLocal('@deep-foundation/core', 'Contain')]?.forEach((contain) => {\n      //     const item = contain?.to;\n      //     const propery = item?.outByType[deep.idLocal('@deep-foundation/jsonschema', 'Property')]?.[0];\n      //     const uipropery = item?.outByType[deep.idLocal('@deep-foundation/jsonschema-form', 'UIProperty')]?.[0];\n      //     const required = propery?.inByType?.[deep.idLocal('@deep-foundation/jsonschema', 'Required')]?.find(r => r.from_id === schemaId);\n      //     const name = contain?.value?.value || contain?.id;\n      //     if (propery) {\n      //       if (required) schema.required.push(name);\n      //       propertyLinks[name] = propery;\n      //       properties[name] = propery?.value?.value;\n      //     }\n      //     if (uipropery) {\n      //       uipropertyLinks[name] = uipropery;\n      //       uiproperties[name] = uipropery?.value?.value;\n      //     }\n      //   });\n      //   data.forEach((link) => {\n      //     const name = deep.nameLocal(link.type_id);\n      //     if (propertyLinks?.[name]) {\n      //       formDataLinks[name] = link;\n      //       formData[name] = link?.value?.value;\n      //     }\n      //   });\n      // }\n      // const propertyLinksRef = go.useRefValue(propertyLinks);\n      // const formDataLinksRef = go.useRefValue(formDataLinks);\n      // console.log('schema', schema, propertyLinks, formData, formDataLinks);\n\n      const { data: schemaData, loading: schemaLoading } = deep.useSubscription({\n        type_id: { _in: [Possible, Required] },\n        from_id: typeId,\n        return: {\n          _type: { relation: 'type' },\n          _properties: {\n            relation: 'to',\n            return: {\n              _property: {\n                relation: 'in',\n                type_id: { _in: [Property, UIProperty] },\n              },\n            },\n          },\n        },\n      });\n\n      const possibles = deep.useLocalQuery({ type_id: Possible, from_id: typeId });\n\n      const { data, loading: dataLoading } = deep.useSubscription(schemaLoading ? {} : {\n        type_id: Contain,\n        from_id: linkId,\n        string: { value: { _in: possibles.map(p => p?.value?.value) } },\n        to: {\n          type_id: { _in: possibles.map(p => p.to_id) },\n        },\n        return: {\n          _to: { relation: 'to' },\n        },\n      }, { skip: !!schemaLoading });\n\n      const { schema, uiproperties, formData } = React.useMemo(() => {\n        if (!!schemaLoading || !!dataLoading) return {};\n\n        const schema = {\n          type: 'object',\n          properties: {},\n          required: [],\n        };\n\n        const formData = {};\n\n        const uiproperties = {};\n\n        const type = deep.get(typeId);\n\n        possibles.forEach(p => {\n          const [required] = deep.ml.select({ type_id: Required, from_id: typeId, to_id: p.to_id });\n          const [property] = deep.ml.select({ type_id: Property, to_id: p.to_id });\n          const [uiproperty] = deep.ml.select({ type_id: UIProperty, to_id: p.to_id });\n          schema.properties[p?.value?.value] = property?.value?.value;\n          if (uiproperty?.value?.value) uiproperties[p?.value?.value] = uiproperty?.value?.value;\n          if (required) schema.required.push(p?.value?.value);\n          const [field] = deep.ml.select({ type_id: Contain, from_id: linkId, string: p?.value?.value });\n          if (field) formData[p?.value?.value] = field?.to?.value?.value;\n        });\n\n        return { schema, uiproperties, formData };\n      }, [schemaData]);\n\n      const memRef = React.useRef({});\n      const define = React.useCallback(async (name, value) => {\n        const [possible] = deep.ml.select({ type_id: Possible, from_id: typeId });\n        const [exists] = deep.ml.select({ type_id: Contain, from_id: linkId, string: name });\n        if (memRef.current[name] || exists) await deep.value(exists.to_id, value);\n        else if (possible) {\n          await deep.insert({\n            type_id: possible.to_id, [typeof(value)]: value,\n            containerId: linkId, name,\n          });\n        } else throw new Error(`!possible for name ${name} value ${value}`);\n      }, []);\n\n      const onSubmit = useCallback(async ({ errors, formData }) => {\n        for (let key in formData) { define(key, formData[key]); }\n      }, [])\n\n      console.log({ schema, validator, formData, uiproperties, schemaData, data });\n\n      return  <c.Box color='deepColor'>\n        {!!schema ? <>\n          <Form\n            schema={schema}\n            validator={validator}\n            formData={formData}\n            uiSchema={uiproperties}\n            noHtml5Validate={false}\n            liveValidate\n            // onChange={useCallback(({}) => {\n            // }, [])}\n            onSubmit={onSubmit}\n            // onError={log('errors')}\n          >\n            <c.Box>\n              <Button type=\"submit\" w='100%' children={<>Update</>} {...buttonProps}/>\n            </c.Box>\n          </Form>\n        </> : <c.Button isLoading/>}\n      </c.Box>;\n    }\n  }\n",
