        "value": "async ({ deep, require }) => {\r\n  const React = require('react');\r\n  const axios = require('axios');\r\n  const {\r\n    Alert,\r\n    AlertIcon,\r\n    Input,\r\n    Button,\r\n    InputGroup,\r\n    Stack,\r\n    Box,\r\n    FormControl,\r\n    InputRightElement \r\n  } = require('@chakra-ui/react');\r\n\r\n  const selectUrlPassport = await deep.select({\r\n    type_id: {\r\n      _id: ['@l4legenda/passport-username-password-ui', \"UrlPassport\"]\r\n    }\r\n  })\r\n\r\n  const UrlPassport = selectUrlPassport?.data?.[0]?.value?.value;\r\n\r\n  const requestLogin = (username, password) => {\r\n    return axios.post(`${UrlPassport}/passport`, {\r\n      username: username,\r\n      password: password,\r\n      linkId: deep.linkId,\r\n    })\r\n  }\r\n\r\n  return ({ fillSize, style, link }) => {\r\n    const [username, setUsername] = React.useState(\"\");\r\n    const [password, setPassword] = React.useState(\"\");\r\n    const [showPassword, setShowPassword] = React.useState(false);\r\n    const [errorMessage, setErrorMessage] = React.useState(\"\");\r\n    const handleShowClick = () => setShowPassword(!showPassword);\r\n    \r\n    const handlerSubmitForm = async (e) => {\r\n      e.preventDefault();\r\n      const response = await requestLogin(username, password);\r\n      console.log(response);\r\n      if(response?.data?.error) {\r\n        setErrorMessage(response.data.error);\r\n      }else if(response?.data?.token) {\r\n        await deep.login({\r\n          token: response.data.token\r\n        })\r\n      }\r\n      return false;\r\n    }\r\n\r\n    return <Box minW={{ base: \"90%\", md: \"468px\" }}>\r\n          <form onSubmit={handlerSubmitForm}>\r\n            <Stack\r\n              spacing={4}\r\n              p=\"1rem\"\r\n              backgroundColor=\"whiteAlpha.900\"\r\n              boxShadow=\"md\"\r\n            >\r\n              <FormControl>\r\n                <InputGroup>\r\n                  <Input \r\n                    type=\"text\"\r\n                    placeholder=\"Username\"\r\n                    value={username}\r\n                    onInput={(e)=>{setUsername(e.target.value)}}\r\n                  />\r\n                </InputGroup>\r\n              </FormControl>\r\n              <FormControl>\r\n                <InputGroup>\r\n                  <Input\r\n                    type={showPassword ? \"text\" : \"password\"}\r\n                    placeholder=\"Password\"\r\n                    value={password}\r\n                    onInput={(e)=>{setPassword(e.target.value)}}\r\n                  />\r\n                  <InputRightElement width=\"4.5rem\">\r\n                    <Button h=\"1.75rem\" size=\"sm\" onClick={handleShowClick}>\r\n                      {showPassword ? \"Hide\" : \"Show\"}\r\n                    </Button>\r\n                  </InputRightElement>\r\n                </InputGroup>\r\n              </FormControl>\r\n              {\r\n                !!errorMessage && (\r\n                  <Alert status='error'>\r\n                    <AlertIcon />\r\n                    {errorMessage}\r\n                  </Alert>\r\n                )\r\n              }\r\n              <Button\r\n                borderRadius={0}\r\n                type=\"submit\"\r\n                variant=\"solid\"\r\n                colorScheme=\"teal\"\r\n                width=\"full\"\r\n              >\r\n                Login\r\n              </Button>\r\n            </Stack>\r\n          </form>\r\n        </Box>\r\n  }\r\n}",
