        "value": "async (req, res, next, { deep, require, gql }) => {\r\n  console.log(\"test\")\r\n  res.header('Access-Control-Allow-Origin', '*');\r\n  res.header('Access-Control-Allow-Headers', 'Origin, X-Requested-With, Content-Type, Accept, Authorization');\r\n  res.header('Access-Control-Allow-Methods', 'GET, POST, PUT, PATCH, DELETE, OPTIONS');\r\n\r\n  if(req.method === 'OPTIONS') {\r\n    res.send();\r\n    return;\r\n  }\r\n\r\n  if(!req.body.username){\r\n    res.send({\r\n      \"error\": \"Username is empty\"\r\n    });\r\n    return;\r\n  }\r\n  if(!req.body.password){\r\n    res.send({\r\n      \"error\": \"Password is empty\"\r\n    });\r\n    return;\r\n  }\r\n  var path = require('path');\r\n  var express = require('express');\r\n  var passport = require('passport');\r\n  var LocalStrategy = require('passport-local');\r\n  var session = require('express-session');\r\n  var crypto = require('crypto');\r\n\r\n  \r\n\r\n  const getJWT = async (linkId) => {\r\n    const result = await deep.apolloClient.query({\r\n      query: gql`query GET_JWT($linkId: Int) { \r\n        jwt(input: {linkId: $linkId}) {\r\n\t\t      linkId,\r\n          token\r\n        } \r\n      }`,\r\n      variables: { linkId },\r\n    });\r\n    console.log(result);\r\n    return result;\r\n  }\r\n\r\n  const insertRule = async (options) => {\r\n    const { data: [{ id: ruleId }] } = await deep.insert({\r\n      type_id: await deep.id('@deep-foundation/core', 'Rule'),\r\n      out: { data: [\r\n        {\r\n          type_id: await deep.id('@deep-foundation/core', 'RuleSubject'),\r\n          to: { data: {\r\n            type_id: await deep.id('@deep-foundation/core', 'Selector'),\r\n            out: { data: options.subject },\r\n          } }\r\n        },\r\n        {\r\n          type_id: await deep.id('@deep-foundation/core', 'RuleObject'),\r\n          to: { data: {\r\n            type_id: await deep.id('@deep-foundation/core', 'Selector'),\r\n            out: { data: options.object },\r\n          } }\r\n        },\r\n        {\r\n          type_id: await deep.id('@deep-foundation/core', 'RuleAction'),\r\n          to: { data: {\r\n            type_id: await deep.id('@deep-foundation/core', 'Selector'),\r\n            out: { data: options.action },\r\n          } }\r\n        },\r\n      ] },\r\n    });\r\n  };\r\n\r\n\r\n  const currentLinkId = req.body.linkId;\r\n\r\n  let globalUserId = null;\r\n\r\n  const router = express.Router();\r\n  router.use(session({\r\n    secret: 'keyboard cat',\r\n    resave: false,\r\n    saveUninitialized: false,\r\n  }));\r\n  router.use(passport.initialize());\r\n  router.use(passport.session());\r\n  router.use(passport.authenticate('session'));\r\n\r\n  passport.serializeUser(function(user, cb) {\r\n    process.nextTick(function() {\r\n      console.log('serializeUser', user);\r\n      cb(null, { id: user.id });\r\n    });\r\n  });\r\n  passport.deserializeUser(function(user, cb) {\r\n    process.nextTick(function() {\r\n      console.log('deserializeUser', user);\r\n      return cb(null, user);\r\n    });\r\n  });\r\n\r\n  passport.use(new LocalStrategy(async function verify(username, password, cb) {\r\n    crypto.pbkdf2(password, 'salt', 310000, 32, 'sha256', async function(err, hashedPassword) {\r\n      if (err) {\r\n        // if error, return error\r\n        console.log(err);\r\n        cb(err, null);\r\n        return;\r\n      }\r\n      // try to found exists username      \r\n      const { data: usernames } = await deep.select({\r\n        type_id: await deep.id('@timax/passport-authorization', 'Username'),\r\n        string: { value: { _eq: username } },\r\n      });\r\n      console.log(usernames.length)\r\n      if (usernames.length) {\r\n        // if username found\r\n        const usernameId = usernames[0].id;\r\n        const { data: passwords } = await deep.select({\r\n          type_id: await deep.id('@timax/passport-authorization', 'Password'),\r\n          from_id: usernameId,\r\n        });\r\n\r\n        if (!passwords.length) {\r\n          // if password not found\r\n          cb(\"Password not found\", null);\r\n          return;\r\n        }\r\n        const foundedPassword = passwords?.[0]?.value?.value;\r\n        console.log(passwords,foundedPassword )\r\n        console.log(hashedPassword.toString() )\r\n        if (foundedPassword != hashedPassword.toString()) {\r\n          // if password incorrect\r\n          cb('Incorrect password', null);\r\n          return;\r\n        }\r\n        // if password correct\r\n        const { data: [{id: userId}] } = await deep.select({\r\n          type_id: await deep.id('@deep-foundation/core', 'User'),\r\n          in: {\r\n            id: passwords[0].id\r\n          },\r\n        });\r\n\r\n        \r\n        globalUserId = userId;\r\n        cb(null, usernameId);\r\n      } else {\r\n        // if username not found, create new username\r\n        cb('  ');\r\n\r\n      }\r\n\r\n      const hasAllowLogin = await deep.can(\r\n        currentLinkId,\r\n        globalUserId,\r\n        await deep.id('@deep-foundation/core', 'AllowLogin')\r\n      )\r\n      if(!hasAllowLogin) {\r\n        const r = await deep.insert({\r\n          type_id: await deep.id('@l4legenda/auth-core', 'ActionLoginUser'),\r\n          from_id: currentLinkId,\r\n          to_id: globalUserId,\r\n        })\r\n        console.log(r);\r\n      }\r\n      \r\n\r\n    return;\r\n\r\n\r\n    });\r\n  }));\r\n  router.use('*', passport.authenticate('local', {}));\r\n\r\n  router.handle(req, res, async (err) => {\r\n    if(err) {\r\n      res.send({ \"error\": err });\r\n    } else {\r\n      const {data: {jwt: {linkId, token}}} = await getJWT(globalUserId);\r\n      res.send({ linkId, token });\r\n    }\r\n\r\n  });\r\n}",
