        "value": "async ({ deep, data: { newLink, oldLink } }) => {\n    await deep.unsafe.hasura.sql(`\nCREATE OR REPLACE VIEW \"public\".\"semantic_types\" AS \n  SELECT\n    instance.id AS id,\n    instance.type_id AS type_id,\n    instance.from_id AS from_id,\n    (CASE WHEN instance.from_id = 0 THEN 0 ELSE (\n      SELECT type_id FROM links WHERE id = instance.from_id\n    ) END) as type_from_id,\n    instance.to_id AS to_id,\n    (CASE WHEN instance.from_id = 0 THEN 0 ELSE (\n      SELECT type_id FROM links WHERE id = instance.to_id\n    ) END) as type_to_id\n  FROM\n    links instance\n  WHERE instance.type_id != 0\n ;\n    `);\n    await deep.unsafe.hasura.sql(`\nCREATE OR REPLACE VIEW \"public\".\"semantic\" AS \n  SELECT DISTINCT ON (cst.type_id, cst.type_from_id, cst.type_to_id)\n    cst.type_id as type_id, cst.type_from_id as type_from_id, cst.type_to_id as type_to_id,\n    (\n      SELECT count(*) FROM semantic_types as st WHERE\n      st.type_id = cst.type_id AND\n      st.type_from_id = cst.type_from_id AND\n      st.type_to_id = cst.type_to_id\n    ) AS count\n  FROM semantic_types as cst\n;\n    `);\n    await deep.unsafe.hasura.query({\n        type: 'track_table',\n        args: {\n            schema: 'public',\n            name: `semantic`,\n        },\n    });\n    return 'ok';\n};\n//# sourceMappingURL=data:application/json;base64,",
